class Header{constructor(e){this.$hamburger=e.find(".j-header-hamburger"),this.bindEvents()}bindEvents(){this.$hamburger.on("click",()=>this.$hamburger.toggleClass("is-active"))}}const header=new Header($("#j-header"));$(document).ready(function(){$(".owl-carousel").owlCarousel({loop:!0,items:1,dots:!0,dotData:!0})});